import { GridItem, Heading, Stack, SimpleGrid } from '@chakra-ui/layout'
import React from 'react'

import AspectCard from './AspectCard'
function Homepage() {
  return (
    <GridItem colStart={1} colSpan={4}>
      {' '}
      <Heading> The Classical Maya </Heading>
      <SimpleGrid direction='row' spacing={27}>
        <AspectCard />
        <AspectCard />
      </SimpleGrid>
    </GridItem>
  )
}

export default Homepage
